	(17, '釜山行', '丧失~~~~~', _binary , '2016-12-03', 1, 'movies\\a232a9d8-2676-4f5d-a4c2-8e93f4ee7264.mp4', 1),
	(18, '猎灵师', '《猎灵师》是一部由IFG互联网电影集团、IFG光影华视、MSI映美传媒、南航传媒、大唐辉煌、弘亦文化、奇树有鱼、影娱宝、正晖映美、容艺传媒、天书奇谈联合出品的系列影片', _binary , '2016-12-03', 1, 'movies\\b25f4470-1185-4cce-bbb6-7c50ce8c1082.mp4', 1),
	(19, '反贪风暴2', '《反贪风暴2》是由黄百鸣监制，林德禄执导，黄浩华编剧，古天乐、张智霖、周渝民、蔡少芬联合主演的动作悬疑片。影片于2016年9月14日18点在中国大陆上映。该片讲述了香港廉政公署调查一起马会与外围赌球的贪污案件并将罪犯绳之以法的故事。', _binary , '2016-12-03', 1, 'movies\\153c2b82-5f60-4a0e-ba23-da777cf53294.mp4', 1),
	(20, '我们的十年', '《我们的十年》是由马伟豪、刘海执导，赵丽颖、乔任梁、吴映洁、范逸臣、班嘉佳、冯铭潮等人主演的一部青春校园爱情片。该片将于2016年9月2日在中国大陆上映。[1] \r\n影片讲述了“假小子”张静依、“理工男”郭宇辰、“钢琴女神”陈伊诺、“事业男”杜浩、“龙套女生”梁小艺、“纯情暖男”卓峰这群好朋友横跨十年的青春故事与记忆。', _binary , '2016-12-04', 1, 'movies\\adb559c8-37a1-4f5f-9391-bd3b3a407640.mp4', 1);
INSERT INTO `movies` (`Vid`, `Vname`, `Vinfo`, `Vpic`, `Vdate`, `id`, `Vsrc`, `views`) VALUES
	(21, '王牌逗王牌', '讲述了囧探宝爷（刘德华饰）与侠盗洛家豪（黄晓明饰）强强联手，与世界恐怖组织抢夺“上帝种子”，所谓“上帝种子”是一种神奇的种子，无论丢在哪里，只需要一点水，就可以迅速长出参天大树。而唯恐天下不乱的恐怖组织居然拿到了这种神奇的“上帝种子”，试图改变甚至掌控这个世界。为了维护世界和平，宝爷和家豪在A梦（王祖蓝饰）、洛家欣（欧阳娜娜饰）等人的帮助下，冒险夺宝拯救世界的故事。[4] ', _binary , '2016-12-04', 1, 'movies\\5942091c-f55f-4ba4-8e78-b118272472c8.mp4', 3),
	(22, ' 蝙蝠侠：黑暗骑士归来(上)', ' 由于第二代罗宾(Jason)的死，使的布鲁斯伟恩从英雄工作中退休，蝙蝠侠自高谭市消失十余年。 然而一连串的治安恶化：变种人(the Mutant)青少年武装团体出现、双面人(Tow face)哈维丹特(Harvey Dent)和小丑(Joker)的逃狱，使的他压抑不住内心想要再度化身为蝙蝠侠的渴望而以五十多岁的高龄重出江湖，与新任的罗宾──13岁少女卡莉 (Carrie Kelley)，和老搭档高登(James Gorden)面对种种坏人的诡计及市民的质疑与不信任。 而同时，美国也正遭受苏联的核武威胁，超人克拉克肯特属于与蝙蝠侠对立的、听从官方命令的一员，也因此蝙蝠侠必须面对同是超级英雄的伙伴的敌对状况，以衰老而坚定的心智面对这个几乎永远不败的上帝之子。', _binary , '2016-12-04', 1, 'movies\\b145abda-0aa7-43d3-8268-185d33473b90.mp4', 2),
	(23, '青云志纪录片13', ' 武侠  神话  古装 ', _binary , '2016-12-04', 1, 'movies\\5fd53473-5436-4a99-86a4-0d3fd329ff16.mp4', 9),
